INSERT INTO `db_page` VALUES ('1', 'Company Profile', ';', '11', '&lt;img src=&quot;http://www.gokingcasting.com/uploadfile/2014/0529/20140529060213602.jpg&quot; /&gt;&lt;br /&gt;\r\n&lt;p class=&quot;heightline24&quot; id=&quot;pagecontent&quot;&gt;      &lt;span style=&quot;font-size:14px;&quot;&gt; Wenzhou Goking Faucet Co. Ltd, established in 2005, is specializing in manufacturing and exporting various kinds of high-quality stainless steel bathroom sanitary ware and focusing on research and development of stainless steel faucets and showers production. Goking Faucet, located in Zhejiang, covers an area of 10,000 square meters production line with annual production capacity of more than 3,000 tons. As concerning about the health problem of drinking water, Goking Faucet has been striving for established a perfect production line and quality management system by its efforts. Meanwhile, the Company has always been constantly introducing advanced process technologies, professional technicians and equipment.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;    The major products are stainless steel faucet including Kitchen Faucet, Basin Faucet, Shower Faucet, Bathtub Faucet, Drinking Faucet, Sink and Bathroom sanitary accessories, etc. The products are making of stainless steel as the mainly material, instead of traditional copper, iron and plastic faucet, which is provided with the superior performance on health, safety, durable, easy cleaning and maintenance and so on. Our products are exported to worldwide, such as U.S., Europe, Australia, and Asia, etc.&lt;br /&gt;\r\n    The guideline of the Company is: to create excellence in technology, quality and service. We keep improving product competitiveness and increasing customer satisfaction, to serve our customers with better quality and service. Goking Faucet sincerely welcomes customers from all over the world to visit and creates brilliant development of cooperation.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;heightline24&quot;&gt; &lt;/p&gt;\r\n', '', '0');
INSERT INTO `db_page` VALUES ('3', 'Inquiry', ';', '', '<div id=\"pagecontent\">\r\n    <!--pagecontent-->\r\n    <p class=\"heightline24\"> &nbsp &nbsp Our major products include valve & valve parts, mechanical parts, pump parts, vehicle parts, kitchen accessories, and lock accessories, etc. by investment casting and sand casting.  Wenzhou Goking Casting Co., Ltd is an ISO 9001:2008 certified manufacturer. We have built quality control procedures into the production process at every stage to control the casting qualities.\r\nIn addition, our developers are in production every day to assist you with your specific manufacturing needs. \r\n <br />&nbsp &nbsp Please send us your drawings or samples of items you request for inquiries.</p>\r\n    <form action=\"/index.php?m=content&a=message\" id=\"feedback\" method=\"post\" name=\"feedback\" onsubmit=\"return feedback_onsubmit()\" target=\"_blank\">\r\n        &nbsp;\r\n        <table cellpadding=\"2\" cellspacing=\"0\" width=\"100%\">\r\n            <tbody>\r\n                <tr>\r\n                    <td width=\"16%\">&nbsp;</td>\r\n                    <td colspan=\"2\">&nbsp;</td>\r\n                </tr>\r\n                <tr>\r\n                    <td align=\"right\" height=\"22\"><strong>Contact：</strong></td>\r\n                    <td height=\"22\" width=\"37%\">&nbsp;</td>\r\n                    <td width=\"47%\"><strong>Message：</strong></td>\r\n                </tr>\r\n                <tr>\r\n                    <td align=\"right\" height=\"25\">Name：</td>\r\n                    <td height=\"25\"><input class=\"text\" type=\"hidden\" name=\"title\" value=\"Message From Inquiry\"> <input class=\"inputcontact\" name=\"name\" size=\"30\" value=\"Please enter your name!\" onfocus=\"this.value=\'\'\"/></td>\r\n                    <td rowspan=\"5\" valign=\"top\"><textarea cols=\"40\" name=\"message\" style=\"height: 138px\"></textarea><input id=\"MessOr\" name=\"MessOr\" type=\"hidden\" value=\"2\" /> <input id=\"action\" name=\"action\" type=\"hidden\" value=\"Send\" /> <input id=\"LanguageID\" name=\"LanguageID\" type=\"hidden\" value=\"2\" /></td>\r\n                </tr>\r\n                <tr>\r\n                    <td align=\"right\" height=\"25\">Email：</td>\r\n                    <td height=\"25\"><input class=\"inputcontact\" name=\"email\" size=\"30\" value=\"Please Enter Your Email Address\" onfocus=\"this.value=\'\'\"/></td>\r\n                </tr>\r\n                <tr>\r\n                    <td align=\"right\" height=\"25\">Company Name：</td>\r\n                    <td height=\"25\"><input class=\"inputcontact\" name=\"companyName\" size=\"30\" /></td>\r\n                </tr>\r\n                <tr>\r\n                    <td align=\"right\" height=\"25\">Tel：</td>\r\n                    <td height=\"25\"><input class=\"inputcontact\" name=\"tel\" size=\"30\" /></td>\r\n                </tr>\r\n                <!--<tr>\r\n	<td align=\"right\" height=\"25\">Fax��</td>\r\n	<td height=\"25\"><input class=\"inputcontact\" name=\"fax\" size=\"30\" /></td>\r\n	</tr>-->\r\n                <tr>\r\n                    <td width=\"16%\">&nbsp;</td>\r\n                    <td align=\"center\">&nbsp;</td>\r\n                    <td align=\"left\"><br /> <input class=\"feckbutton\" name=\"Submit\" type=\"submit\" value=\"Send Inquiry\" /></td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n    </form>\r\n    <script language=\"javascript\">\r\n					function feedback_onsubmit() {\r\n						if (document.feedback.name.value == \"\") {\r\n							alert(\"Please enter your name!\");\r\n							document.feedback.name.focus();\r\n							return false;\r\n						}\r\n						if (document.feedback.tel.value == \"\") {\r\n							alert(\"Please enter Tel!\");\r\n							document.feedback.phone.focus();\r\n							return false;\r\n						}\r\n						if (document.feedback.message.value == \"\") {\r\n							alert(\"Please enter the message content!\");\r\n							document.feedback.message.focus();\r\n							return false;\r\n						}\r\n					}\r\n				</script>\r\n    <!--pagecontent-->\r\n</div>\r\n', '', '0');
INSERT INTO `db_page` VALUES ('4', 'Contact Us', ';', '', '&lt;div&gt;\r\n	&lt;div&gt;\r\n		Wenzhou Goking Faucet Co., Ltd\r\n	&lt;/div&gt;\r\nAdd: Building C, 83 West Yucang Road, Longwan, Wenzhou, Zhejiang, China&lt;br /&gt;\r\nTel: &amp;nbsp;86-577-85505087&amp;nbsp;&amp;nbsp;86-577-85505086&lt;span style=&quot;color:#666666;font-family:Arial;&quot;&gt; &lt;/span&gt;86-577-85505089&lt;br /&gt;\r\nFax: 86-577-86511822&lt;br /&gt;\r\nEmail: faucet@gokinggroup.com&lt;br /&gt;\r\nSkype: goking.faucet&lt;br /&gt;\r\nWebsite: http://www.gokingfaucet.com/\r\n&lt;/div&gt;\r\n&lt;img src=&quot;http://www.gokingcasting.com/uploadfile/2014/0522/20140522055618299.png&quot; /&gt;', '', '0');
INSERT INTO `db_page` VALUES ('30', 'Process', ';', 'Process', '<p><strong><span style=\"font-size:14px;\">Brife Introduce for Stainless steel faucet:</span></strong></p>\r\n<p><span style=\"font-size:14px;\">1.Stainless steel faucet is made from high-graded stainless steel SUS304</span>&amp;SUS316&nbsp;<span style=\"font-size: 14px; \">and its internationally proven that it is non-corrosive and cause no harm to human healthy. Also, it does not contain lead and is rust free.</span></p>\r\n<p><span style=\"font-size:14px;\">2.Unlike brass faucet, stainless steel faucet is casted and this ensures the smoothness of inner &amp; exteral surface. Aesthetically, the look of stainless steel is original &amp; lasting. Being one of the toughest material, it is also durable.<br />\r\n&nbsp;<br />\r\n3.Stainless steel faucet does not require any chroming on the surface. Thus, in the process of producing it, it does not pollute the environment.<br />\r\n&nbsp;<br />\r\n<strong>Main features and specifications:</strong><br />\r\n<br />\r\n1.SUS304</span>&amp;<span style=\"font-size:14px;\">SUS316</span>&nbsp;<span style=\"font-size: 14px; \">without lead, healty and hygiene.</span><br />\r\n<span style=\"font-size: 14px; \">2.Natural Surface with passivation</span><br />\r\n<span style=\"font-size: 14px; \">3.Solid stainless 304</span>&amp;316&nbsp;<span style=\"font-size: 14px; \">of the whole body of the faucet</span><br />\r\n<span style=\"font-size: 14px; \">4.Food safe silicon rings</span><br />\r\n<span style=\"font-size: 14px; \">5.No chromeplated finish</span>.</p>\r\n<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://www.gokingcasting.com/uploadfile/2014/0522/20140522033323310.jpg\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src=\"http://www.gokingcasting.com/uploadfile/2014/0522/20140522033403997.jpg\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://www.gokingcasting.com/uploadfile/2014/0522/20140522033242862.jpg\" /></span>\r\n<p><span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Impact Test &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Impact Test &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Hardness Test&nbsp;</span></p>\r\n<span style=\"font-size:14px;\"><img src=\"http://www.gokingcasting.com/uploadfile/2014/0522/20140522033427431.jpg\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src=\"http://www.gokingcasting.com/uploadfile/2014/0522/20140522033353156.jpg\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://www.gokingcasting.com/uploadfile/2014/0522/20140522033442561.png\" /></span>\r\n<p><span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Wax Injection Machine &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Optical Spectrum Analysis &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Melting Furnace</span></p>\r\n<span style=\"font-size:14px;\">&nbsp; &nbsp;</span>\r\n<p><span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://www.gokingcasting.com/uploadfile/2014/0522/20140522033412633.jpg\" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src=\"http://www.gokingcasting.com/uploadfile/2014/0522/20140522032909621.jpg\" /><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Hydraulic Shaping &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Shell Making Workshop</span></p>\r\n<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://www.gokingcasting.com/uploadfile/2014/0522/20140522034205267.jpg\" /><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\r\n&nbsp;<br />\r\n<br />\r\n', '', '0');
